script: |
  super -f text -I q11686.spq | sort > q11686.out

inputs:
  - name: q11686.spq
    data: |
      SELECT col1 - ( + - col1 ) FROM tab1 (FORMAT parquet) WHERE - col0 * - 64 NOT BETWEEN - col0 AND col0 + - + col1;
  - name: tab1

outputs:
  - name: q11686.out
    data: |
      10
      28
      94
